import React from 'react'
import Sidebar from '../Sidebar/Sidebar';
import './Banner.css';

function Banner(){
    return(
        <>
            <div className='header'>
                <div className = "navbar">
                    <Link to="#" className = "menu-bars">
                        <FaIcons.FaBars onClick={showSideBar}/>
                    </Link>
                </div>>
            </div>
        </>
    )
}

export default Banner;
